import React, { useState } from 'react';

const Card = (props) => {
    const [initialValue, setInitialValue] = useState(props.backgroundImage)
    return (
        <div>
        <h1>{initialValue}</h1>
        <h1>{props.rank}</h1>
        <h1>{props.suit}</h1>
        <h1>{props.cardImage}</h1>
        <h1>{props.backgroundImage}</h1>
        </div>
    );
};

export default Card;
